import React from 'react';

import login from './login';
import SignUp from './SignUp';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { useSelector, useDispatch } from 'react-redux';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const tabHomeNavigation = () => {
	const { isAuthenticated } = useSelector((state) => state.auth);

	return (
		<Tab.Navigator
			tabBarOptions={{
				style: {
					paddingVertical: 3,
					backgroundColor: '#03a9f4'
				},
				inactiveTintColor: '#bbb',
				activeTintColor: '#fff',
				labelStyle: {
					fontSize: 14
				}
			}}
		>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="directions-car" size={24} color={color} />
				}}
				name="Restaurants"
				component={List}
			/>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="account-circle" size={24} color={color} />
				}}
				name="login"
				component={login}
			/>
		</Tab.Navigator>
	);
};

function App() {
	const { isAuthenticated } = useSelector((state) => state.auth);
	const dispath = useDispatch();

	return (
		<NavigationNativeContainer>
			<Stack.Navigator
				screenOptions={{
					headerStyle: {
						backgroundColor: '#03a9f4'
					},
					headerTitle: <Text style={{ fontSize: 23, color: '#fff', fontWeight: 'bold' }}>Shopping Car</Text>,
					headerRight: () => (
						<React.Fragment>
							{isAuthenticated && (
								<TouchableOpacity onPress={() => dispath(logout())}>
									<MaterialIcons
										size={25}
										color="#fff"
										name="exit-to-app"
										style={{ marginRight: 10 }}
									/>
								</TouchableOpacity>
							)}
						</React.Fragment>
					)
				}}
			>
				<Stack.Screen name="Home" component={tabHomeNavigation} />
			</Stack.Navigator>
		</NavigationNativeContainer>
	);
}

export default App;
